function maximumBeauty(items, queries) {

    items = items.sort((a,b)=> a[0]-b[0]);
    let arr=[];
    for(let i =0; i < queries.length; i++){
        let price = queries[i];
        
        arr.push(binarySearch(items, price))      
    }
    return arr;
}

function binarySearch(items, target){
    let left =0;
    let right = items.length-1
    let maxBeauity = 0

    while(left < right){
        let mid = left +Math.floor((right-left)/2);
        if(items[mid][0] > target){
            right = mid-1;
        } else{
            maxBeauity=  Math.max(items[mid][1], maxBeauity);
            left= mid+1;
        }

    }

    return maxBeauity

}


